import React, { useEffect } from "react";

function FetchStockData({ onDataFetch }) {
    useEffect(() => {
        fetch('http://localhost:8080/api/stock_data/')
            .then(response => {
                console.log('API Response:', response);  // 응답 확인
                return response.json();
            })
            .then(data => {
                console.log('Parsed Data:', data);  // 파싱된 데이터 확인
                if (onDataFetch) {
                    onDataFetch(data); // 데이터를 부모 컴포넌트나 콜백 함수로 전달
                }
            })
            .catch(error => console.error('Error Stock Data:', error));
    }, []);

    return null;
}

export default FetchStockData;
